window.bookSummaryJSON = "<p><b>Checked out by a monster—sounds hot, right?</b></p> <p>Except I'm not the type anyone ever gives a second glance to, let alone is interested in. The only things guys check out from me are the books in the library that I oversee.</p> <p>But every day, the same Chupacabra comes back. At first, I think he's just lonely as he prowls behind me as I work, asking me questions.</p> <p>Then I realize he can't read.</p> <p>Knowing his job depends upon it, I offer to teach him, reading stories aloud to the sweet monster. Everything is great until he brings me <i>The Tentacle Kama Sutra</i> and <i>Monster Orgasms</i> with a wink, silently daring me to open them—and like an idiot, I accept the challenge.</p> <p>Now the damned man won't leave me alone. He's always lurking behind my shelves…</p> <p>Chasing me.</p> <p>Charming me.</p> <p>Cherishing me.</p> <p>It's almost like one of those monster romances I secretly read alone at night—but those stories are labeled fiction for a reason.</p> <p>Will I continue to hide behind the pages of my book, or will Chente prove that love isn't just make-believe?</p>"; 
